        this.$urouter.navigateTo(CUSTOMER53URL);
      },

      gotoGonggao() {
        this.$urouter.navigateTo('/pages/makeorder/platformlist/index');
      },
      clickDing(item, index) {
        switch (index) {
          case 0:
            this.$urouter.navigateTo(item.href);
            break;
          case 1:
            // #ifdef H5
            window.location.href = item.href;
            // #endif
            // this.$urouter.navigateTo(item.href);
            break;
          case 2:
            this.showRulesHuishou = true;
            // this.$urouter.navigateTo(item.href);
            break;

          case 3:
            this.$urouter.navigateTo(item.href);
            break;
          case 4:
            this.$urouter.navigateTo(item.href);
            break;
          case 5:
            this.$urouter.navigateTo(item.href);
            break;
          case 6:
            this.$urouter.navigateTo(item.href);
            break;
        }
      },
      clickKongKimItem(item, index) {
        switch (index) {
          case 0:
            this.showRules = true;
            break;
          case 1:
            // #ifdef H5
            // #endif
            this.$urouter.navigateTo(item.href);
            break;
          case 2:
            // this.$urouter.navigateTo(item.href);
            this.gotoDetail();
            break;

          case 3:
            this.$urouter.navigateTo(item.href);
            break;
        }
      },
      closePopup() {
        this.showRules = false;
      },
      gotoMakeOrder(url) {
        this.$urouter.navigateTo(url);
      },
      // 首页数据
      loadData() {
        this.getSwiper();
      },
      // 去搜索
      navToSearch() {
        this.$urouter.navigateTo(
          "/pages/index/search/search/index"
        );
      },
      // 轮播图
      getSwiper() {
        this.$api
          .post(global.apiUrls.gamegameindex)
          .then((res) => {
            if (res.data.code == 1) {
              this.banners = res.data.data.banner_list || [];
              this.article_list = res.data.data.article_list || [];
              this.nearly_transaction_list = res.data.data.nearly_transaction_list || [];
            }
          })
          .catch((err) => {
            console.log(err);
          });
      },
      // 改变颜色
      changeColor(e) {
        const color = `rgb(${e[0]},${e[1]},${e[2]})`;
        this.bgColor = color;
        var animation = uni.createAnimation({
          duration: 700,
          timingFunction: "linear",
        });
        this.animation = animation;
        animation.backgroundColor(this.bgColor).step();
        this.animationData = animation.export();
      },
      // 获取全局配置
      getGlobalConfig() {
        this.$api
          .post(global.apiUrls.aboutUs)
          .then(res => {
            if (res.data.code == 1) {
              this.web_site_logo = res.data.data.web_site_logo;
            }
          })
          .catch(err => {
            console.log(err);
          });
      },
      // 去签到
      navToSign() {
        this.$util.actionAuth(() => {
          this.$urouter.navigateTo('/pages/user/signin/signin-page/index')
        })
      }
    },
  };
</script>
